$(function() {

    var portfolio = $("#portfolio ")
    
        $("#portfolio").slick({
            arrows: false,
            dots: true,
            speed: 500,
            slidesToShow: 2,
            slidesToScroll:2,
            responsive: [{
                breakpoint: 768,
                settings: {
                    slidesToShow: 1,
                    slidesToScroll:1,
    
                }
            }]
            
        });
    
    $('#portfolio-arrow-prev').on("click", function(event) {
        event.preventDefault();
        portfolio.slick("slickPrev");
    });
    
    $('#portfolio-arrow-next').on("click", function(event) {
        event.preventDefault();
        portfolio.slick("slickNext");
    });
    
});